  `map_name` varchar(35) NOT NULL,
  `map_theme` int(11) NOT NULL,
  PRIMARY KEY (base_maps_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

INSERT INTO `base_maps` (`base_maps_id`, `map_name`, `map_theme`) VALUES
(1, 'Candy Core Mine', 2),
(2, 'Sugar Rock', 2),
(3, 'Acrospire', 3),
(4, 'Blitz Beach', 0),
(5, 'Mechanism', 1),
